declare const SQL_QUERY = "\nUPDATE OR IGNORE Experience SET\n  \"type\" = IFNULL(@type, \"type\"), \"employer\" = IFNULL(@employer, \"employer\"), \"role\" = IFNULL(@role, \"role\"), \"startDate\" = IFNULL(@startDate, \"startDate\"), \"endDate\" = IFNULL(@endDate, \"endDate\"), \"createdAt\" = IFNULL(@createdAt, \"createdAt\"), \"updatedAt\" = IFNULL(@updatedAt, \"updatedAt\"), \"deletedAt\" = IFNULL(@deletedAt, \"deletedAt\"), \"personId\" = IFNULL(@personId, \"personId\")\nWHERE\n  \"personId\" = @personId AND \"type\" = @type AND \"employer\" = @employer AND \"role\" = @role\n";
export default SQL_QUERY;
